  6,\n\t\"tags\": [],\n\t\"title\": \"2011 Aerial survey of distribution and abundance
  of western Pacific leatherback turtles (Dermochelys coriacea) in coastal waters
  of Oregon and Washington\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-09-26T22:58:04.185968\",\n\t\"name\": \"2011-aerial-survey-of-distribution-and-abundance-of-western-pacific-leatherback-turtles-dermoch\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Aerial surveys were conducted during 10
  - 29 September 2011 to determine distribution and abundance of endangered leatherback
  turtles (Dermochelys coriacea) in waters between Cape Blanco, Oregon and US/Canada
  maritime border, west to the 2000m isobath. The region has been designated as leatherback
  turtle critical habitat in support of Endangered Species Act mandates (Federal Register
  notice 77 (17) FR 4170, January 26, 2012). Previous knowledge of leatherback turtle
  use of US EEZ waters in the Pacific Northwest came primarily from opportunistic
  sightings from platforms of opportunity, telemetry deployments that originated from
  western Pacific nesting beaches (Benson et al. 2007a; 2011), and a previous systematic
  survey conducted during 2010.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
